import {
    Select,
    MenuItem
} from '@mui/material';

const OrderPage = ({ dataList }) => {

    return (
        <FormControl fullWidth>
            <InputLabel id="item-label">Item</InputLabel>
            <Select
                labelId="item-label"
                label="Item"
            >
                {dataList.map(item => (
                    <MenuItem key={item.id} value={item.name}>
                        {item.name}
                    </MenuItem>
                ))}
            </Select>
        </FormControl>
    );
};
export default OrderPage
